import "./compo.css";
import { Link } from "react-router-dom";
const Login = () => {
  return (
    <>
      <div className="login-pop">
        <h1 className="name">LOGIN</h1>
        <label htmlFor="#user">Username</label>
        <input autoFocus id="user" placeholder="username" type="text" />
        <label htmlFor="#pass">Password</label>
        <input id="pass" placeholder="password" type="text" />
        <button className="login-btn login-btn-2">Login</button>
        <span>Don't have a acoount?</span>
        <Link to="/signup">signup</Link>
      </div>
    </>
  );
};

export default Login;
